import logo from './logo.svg';
import './App.css';
import Background from './components/background/Background';

function App() {
  return (
    <div className="App">
      <section className="pt-br">
        <Background 
          color="#23b2e3"
          language="PT"
          title="TÁ COM DÚVIDA NO TAMANHO?"
          sub="RELAXA QUE A GENTE TE AJUDA!"
          button="CLICK ME"
        />
      </section>
      <section className="en-us">
        <Background 
          color="#fa7b24"
          language="EN"
          title="NOT SURE ABOUT THE SIZE?"
          sub="NO WORRIES, WE'LL HELP YOU!"
          button="CLICK ME"
        />
      </section>
    </div>
  );
}

export default App;
